import "./App.css";
import Character from "./Component/character";
import { Routes, Route, withRouter } from "react-router-dom";
import SingleCharater from "./Component/singleCharacter";

function App() {
  return (
    <div className="App">
      <div>Hello World!</div>
      <Routes>
        <Route
          exact
          path="/singleCharater"
          render={(routeProps) => {
            return <SingleCharater />;
          }}
        />
        {/* <Route
          exact
          path="/"
          render={(routeProps) => {
            return <Character />;
          }}
        /> */}
      </Routes>
    </div>
  );
}

export default App;
